CREATE TABLE experiments (
    experiment_id INT PRIMARY KEY,
    experiment_name TEXT,
    start_date DATE,
    end_date DATE
);

CREATE TABLE metrics (
    metric_id INT PRIMARY KEY,
    metric_name TEXT,
    description TEXT
);

CREATE TABLE experiment_conditions (
 id INT PRIMARY KEY,
 condition_name VARCHAR(255),
 metric1 INT,
 metric2 INT
);

CREATE TABLE experiment_results (
 id INT PRIMARY KEY,
 experiment_id INT,
 result_date DATE,
 result_value DECIMAL
);

CREATE TABLE experiment_participants (
 id INT PRIMARY KEY,
 participant_name VARCHAR(255),
 participant_age INT,
 participant_gender VARCHAR(10)
);

CREATE TABLE experiment_locations (
 id INT PRIMARY KEY,
 location_name VARCHAR(255),
 location_address VARCHAR(255),
 location_city VARCHAR(50)
);

CREATE TABLE experiment_analysis (
 id INT PRIMARY KEY,
 analysis_type VARCHAR(100),
 analysis_result VARCHAR(255),
 analysis_date DATE
);
